import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';
import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Kebab Koubideh',
    description: 'Koobideh is the Iran’s signature Kebab and the most famous of them all. It is made from ground lamb, beef or chicken mixed with chopped onions.',
    price: 300,
  },
  {
    id: 'm2',
    name: 'Joojeh Kebab',
    description: 'Joujeh Kabab is barbecued chicken with olive oil, tomatoes and saffron.',
    price: 350,
  },
  {
    id: 'm3',
    name: 'Kebab Barg',
    description: 'Barg is in fact barbecued lamb, chicken or beef kebab dish. The main ingredients of Kabab-e Barg are fillets of beef tenderloin, lamb shank, onions, safron, olive oil and mild spices.',
    price: 300,
  },
  {
    id: 'm4',
    name: 'Shishlik  Kebab',
    description: 'Shishlik meaning skewered meat is originally made of lamb and popular in many countries. In Iran, it is grilled meat with bones, previously marinated in onion, olive oil and saffron.',
    price: 400,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
